import React from "react";

function SearchBar() {
  return (
    <div className="searchbar">
      <label>Chess.com username: </label>
      <input name="username" type="search" placeholder="Enter username"></input>
      &nbsp; &nbsp; 
      <label>From: </label>
      <input name="fromDate" type="month"></input>
      &nbsp; &nbsp; 
      <label>To: </label>
      <input name="toDate" type="month" ></input>

    </div>
  )
}

export default SearchBar
